window.bookSummaryJSON = "<p>I wasn’t sure what to expect when arriving in Salem.<br> Forced to marry a man I’ve never met, attend a private university I’d never heard of, and the whispers of a rumored secret society filling the halls.<br> This life would be near unbearable with my insufferable fiancé if it wasn’t for his uncle, his best friend, and his enemy.<br> When none of them are willing to let me go, it sends us down a path I’m not sure any of us will survive.<br> The life I was promised is distorted behind smoke and mirrors. The truth cloaked by Deceit.</p>"; 
